tables.table_schema:
CREATE TABLE program_impact_data (
  id INT PRIMARY KEY,
  initiative_name STRING,
  impact_metric STRING,
  impact_value FLOAT
);

CREATE TABLE program_outcomes (
  id INT PRIMARY KEY,
  initiative_name STRING,
  outcome_description STRING,
  outcome_rating INT
);

CREATE TABLE ImpactData (
  program_id INT PRIMARY KEY,
  impact_description TEXT,
  date_recorded DATE
);

CREATE TABLE Outcomes (
  outcome_id INT PRIMARY KEY,
  program_id INT,
  outcome_metric TEXT,
  outcome_value INT
);

CREATE TABLE NonprofitInitiatives (
  initiative_id INT PRIMARY KEY,
  initiative_name TEXT,
  start_date DATE,
  end_date DATE
);

CREATE TABLE impact_data (
    id INT PRIMARY KEY,
    initiative_id INT,
    impact_description TEXT,
    impact_date DATE
);

CREATE TABLE outcomes (
    id INT PRIMARY KEY,
    initiative_id INT,
    outcome_description TEXT,
    outcome_date DATE
);

CREATE TABLE initiatives (
    id INT PRIMARY KEY,
    initiative_name TEXT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE organizations (
    id INT PRIMARY KEY,
    organization_name TEXT,
    location TEXT,
    contact_email TEXT
);

CREATE TABLE programs (
    id INT PRIMARY KEY,
    program_name TEXT,
    program_type TEXT,
    organization_id INT
);
